export const PostPage = ({ cats }) => {
  return (
    cats.map()
  )
};

export default PostPage;

PostPage.getInitialProps = async (ctx) => {
  const res = await fetch("https://cat-fact.herokuapp.com/facts");
  const json = await res.json();
  return { json };
};
